import { Button } from "antd";

function Navbar() {
  /* const navigate = useNavigate();*/

  return (
    <nav className="Navbar">
      <div style={{ fontSize: '24px', color: 'white' }}>  
        <Link to="/" style={{ color: 'white' }}>
          CV Torrent - Matches
        </Link>
      </div>
    </nav>
  );
}

export default Navbar;
